import React, { useState } from 'react';

const [appletView, setAppletView] = useState("home");

function Navbar() {

    return(
        
        /* NAVBAR */
        <nav id="navbar" class="navbar sticky-top navbar-expand-lg navbar-dark bg-dark">
            <div class="container-fluid">

                <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>

                <div class="collapse navbar-collapse" id="navbarNav">
                
                    <ul class="navbar-nav">
                        <li class="nav-item">
                            <a class="nav-link" href="#home" onClick={setAppletView("home")}>Home</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#clients" onClick={setAppletView("clients")}>Clients</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#new-client" onClick={setAppletView("new-client")}>[Add New Client]</a>
                        </li>
                    </ul>

                </div>
                
            </div>
        </nav>
    );

};

export default Navbar;
